import React, { FC } from 'react';
import styles from './EmployeeItem.module.scss';
import Employee from '../../../models/Employee';

interface EmployeeItemProps {
  employee: Employee;
}

const EmployeeItem: FC<EmployeeItemProps> = ({employee}) => (
  // <div className={styles.EmployeeItem}>
    <div className="card bg-light">
  <div className="card-header">{employee.id} </div>
  <div className="card-body">
    <h5 className="card-title">{employee.firstName} {employee.lastName}</h5>
    <p className="card-text">{employee.title}</p>
    <p className="card-text">{employee.city}, {employee.country}</p>
  </div>
</div>
  // </div>
);

export default EmployeeItem;
